import React from 'react';
import './SessionsPanel.css';
import { faAngleRight } from '@fortawesome/free-solid-svg-icons';
import Session from './Session'

class SessionsPanel extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <section id="SessionsPanel" className={this.props.visible ? 'visible' : null}>
                <section id="SessionsPanelButtons">
                    <FontAwesomeIcon icon={faAngleRight} className="button" onClick={this.props.hideSessionsPanel} />
                </section>
                <section id="SessionsList">
                    {this.props.sessions.map(session => <Session key={session.id} title={session.title} />)}
                </section>
            </section>
        );
    }
}

export default SessionsPanel;
